import React, {useState} from 'react';
import {Link, useNavigate} from 'react-router-dom';
import SearchBar from "./SearchBar";
import '../Navbar.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
    faSyncAlt,
    faListUl,
    faHistory,
    faHeart,
    faSearch,
    faClock,
    faRandom,
    faStar,
    faUsers,
    faUserFriends,
    faBook,
    faInfoCircle,
  } from '@fortawesome/free-solid-svg-icons';

const Navbar = ({user,onMenuToggle,setIsModalOpen,logout}) => {
    const [isMenuOpen,setIsMenuOpen] = useState(false);
    const [isModalOpenState,setIsModalOpenState] = useState(false);
    const navigate = useNavigate();

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
        onMenuToggle(!isMenuOpen);
    };

  const toggleModal = () => {
      setIsModalOpenState(!isModalOpenState);
        setIsModalOpen(!isModalOpenState);
    }

    const handleSearch = (term) => {
        navigate(`/search?search=${term}`);
    }

    const handleLogout = () => {
        logout();
        setIsModalOpenState(false)
        navigate("/login");
};

const handleLogin = () => {
       setIsModalOpenState(false)
     navigate("/login");
    }

const handleRegister = () => {
      setIsModalOpenState(false)
       navigate("/register");
   }
   
   console.log("Navbar user prop:", user);

  return (
    <nav className="navbar navbar-light bg-light">
            <div className="container-fluid">
                <button className="navbar-toggler" type="button" onClick={handleMenuToggle}>
                    <span className="navbar-toggler-icon"></span>
                </button>
                <Link className="navbar-brand" to="/">Manga Reader</Link>
                <div className="collapse navbar-collapse">
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <Link className="nav-link" to="/">Home</Link>
                        </li>
                        {user ? (
                            <li className="nav-item">
                                <Link className="nav-link" to="/search"> Search</Link>
                            </li>
                        ) : (
                            null
                        )}
                        {user ? (
                            <li className="nav-item">
                                <Link className="nav-link" to="/advanced-search"> Advanced Search</Link>
                            </li>
                        ) : (
                                null
                            )}
                    </ul>
                    <div className="d-flex">
                        {user ? (
                            <div className='d-flex align-items-center'>
                                <p className='me-2'>Welcome, {user.username}!</p>
                                <button className='btn btn-danger me-2' onClick={logout}>Logout</button>
                            </div>
                        ) : (
                            <div className='d-flex align-items-center'>
                                <Link className="nav-link me-2" to="/login"> Login</Link>
                                <Link className="nav-link" to="/register"> Register</Link>
                            </div>
                        )}
                    </div>
                </div>
            </div>
             {isMenuOpen && (
            <div className="side-menu">
                <div className="side-menu-header">
                    <h5 className="side-menu-title">Manga App</h5>
                    <button className="close-menu-button" onClick={handleMenuToggle}>X</button>
                </div>
                 <ul className="side-menu-list">
                    <li className="side-menu-item">
                        <strong><FontAwesomeIcon icon={faSyncAlt} className="me-1"/>Follows</strong>
                        <ul className="sub-menu">
                            <li>
                                 <Link to="/" onClick={handleMenuToggle}><FontAwesomeIcon icon={faSyncAlt} className="me-1"/>Updates (WIP)</Link>
                             </li>
                            <li>
                                <Link to="/" onClick={handleMenuToggle}><FontAwesomeIcon icon={faListUl} className="me-1"/>Library (WIP)</Link>
                             </li>
                            <li>
                                <Link to="/user-history" onClick={handleMenuToggle}><FontAwesomeIcon icon={faHistory} className="me-1"/>Reading history</Link>
                            </li>
                            <li>
                                <Link to="/user-favourites" onClick={handleMenuToggle}><FontAwesomeIcon icon={faHeart} className="me-1"/>Favourites</Link>
                            </li>
                        </ul>
                    </li>
                    <li className="side-menu-item">
                        <strong><FontAwesomeIcon icon={faSearch} className="me-1"/>Titles</strong>
                         <ul className="sub-menu">
                            <li>
                                <Link to="/advanced-search" onClick={handleMenuToggle}><FontAwesomeIcon icon={faSearch} className="me-1"/>Advanced search</Link>
                            </li>
                            <li>
                                <Link to="/recent-manga" onClick={handleMenuToggle}><FontAwesomeIcon icon={faClock} className="me-1"/>Recently added</Link>
                            </li>
                            <li>
                                <Link to="/random-manga" onClick={handleMenuToggle}><FontAwesomeIcon icon={faRandom} className="me-1"/>Random</Link>
                            </li>
                             <li>
                                <Link to="/" onClick={handleMenuToggle}><FontAwesomeIcon icon={faStar} className="me-1"/>Recommended (WIP)</Link>
                           </li>
                        </ul>
                    </li>
                    <li className="side-menu-item">
                       <strong><FontAwesomeIcon icon={faUsers} className="me-1"/>Community</strong>
